    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File /n               Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB represents a seamless national file with no overlaps or gaps between parts,
    however, eachn               TIGER/Line shapefile is designed to stand alone as
    an independent data set, or they can be combined to cover the entire nation.nn               Block
    Groups (BGs) are clusters of blocks within the same census tract. Each census tract
    contains at least one BG, and BGs are uniquely numbered within census tracts.  BGs
    have a valid code range ofn               0 through 9. BGs have the same first digit
    of their 4-digit census block number from the same decennial census.  For example,
    tabulation blocks numbered 3001, 3002, 3003,.., 3999 within census tractn               1210.02
    are also within BG 3 within that census tract.  BGs coded 0 are intended to only
    include water area, no land area, and they are generally in territorial seas, coastal
    water, and Great Lakesn               water areas. Block groups generally contain
     between 600 and 3,000 people.  A BG usually covers a contiguous area but never
    crosses county or census tract boundaries. They may, however, cross then               boundaries
    of other geographic entities like county subdivisions, places, urban areas, voting
    districts, congressional districts, and American Indian / Alaska Native / Native
    Hawaiian areas. nn              The BG boundaries in this release are those that
    were delineated as part of the Census Bureau's Participant Statistical Areas Program
    (PSAP) for the 2010 Census.  n            ",nt"license_title": null,nt"extras":
